import React from 'react';
import './MenuItem.css';
import { Card } from 'bootstrap';

const MenuItem = ({ image, title, link }) => {
  return (
    <Card>
      <Card.Img variant='top' src={image} />
      <Card.Body>
        <Card.Title>Card title</Card.Title>
      </Card.Body>
    </Card>
  );
};

export default MenuItem;
